import React from 'react';
import './style2.css';
import {Col, Row} from 'react-bootstrap';
import { Link } from "react-router-dom";

const Button =({downloadTest, value})=>{
    return(
        <input type='button' onClick={downloadTest} value={value}/>
    );
}

export default Button;
